const Navbar = () => {
    return (
        <nav className="navbar">
            <div>
                <h1><a href="/home">MINI TURBO DERBY</a></h1>
                
            </div>

            <hr />

            <div>
                <button><a href="/track">Track</a></button>
                <button><a href="/garage">Garage</a></button>
                <button><a href="/bank">Bank</a></button>
                <button><a href="/how-to-play">How to play!</a></button>
                <button><a href="/credits">Credits</a></button>
            </div>
        </nav>
    );
}
 
export default Navbar;
